import React, { useEffect } from 'react';
import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import { Box } from '@mui/material';
import { BlockchainProvider } from './contexts/BlockchainContext';

// Import components
import ProfessionalLogin from './pages/ProfessionalLogin';
import ProfessionalDashboard from './pages/ProfessionalDashboard';
import AdminDashboard from './pages/AdminDashboard';
import ProjectCreate from './pages/ProjectCreate';
import Marketplace from './pages/Marketplace';
import CarbonCredits from './pages/CarbonCredits';
import PaymentDistribution from './pages/PaymentDistribution';
import Reports from './pages/Reports';
import ProfessionalNavbar from './components/ProfessionalNavbar';

{/* Layout wrapper for authenticated routes with professional navbar */}
const AuthenticatedLayout = ({ children }) => (
  <Box>
    <ProfessionalNavbar />
    <Box 
      sx={{ 
        mt: 8, // Account for fixed navbar
        minHeight: '100vh',
        backgroundColor: '#F8FAFC',
      }}
    >
      {children}
    </Box>
  </Box>
);

// Simple protected route component
const ProtectedRoute = ({ children }) => {
  const isAuthenticated = localStorage.getItem('userInfo') !== null;
  return isAuthenticated ? children : <Navigate to="/login" replace />;
};

function App() {
  const location = useLocation();

  // Ensure users start at login page when app loads
  useEffect(() => {
    // If user visits root and is not authenticated, clear any stale data
    if (location.pathname === '/' && !localStorage.getItem('userInfo')) {
      localStorage.removeItem('auth_token');
      localStorage.removeItem('userInfo');
    }
  }, [location.pathname]);

  return (
    <BlockchainProvider>
      <Box className="App">
        <Routes>
          {/* Public routes */}
          <Route path="/login" element={<ProfessionalLogin />} />

          {/* Protected routes with layout */}
          <Route path="/" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/dashboard" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/user/dashboard" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/projects/create" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProjectCreate />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/projects" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/data-collection" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/verification" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <ProfessionalDashboard />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/marketplace" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <Marketplace />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/carbon-credits" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <CarbonCredits />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/payments" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <PaymentDistribution />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          <Route path="/reports" element={
            <ProtectedRoute>
              <AuthenticatedLayout>
                <Reports />
              </AuthenticatedLayout>
            </ProtectedRoute>
          } />

          {/* Admin routes */}
          <Route path="/admin/dashboard" element={
            <ProtectedRoute>
              <AdminDashboard />
            </ProtectedRoute>
          } />

          {/* Fallback route */}
          <Route path="*" element={<Navigate to="/login" replace />} />
        </Routes>
      </Box>
    </BlockchainProvider>
  );
}

export default App;
